  <Menu mode="horizontal">
    <Menu.Item key="logo" icon={<Logo />} />
    <Menu.Item key="rent">
      <Link to="/accommodation">
        Разместить объявление
      </Link>
    </Menu.Item>
    <Menu.Item key="login">
      Войти
    </Menu.Item>
    <Menu.Item key="place">
      <Link to="/accommodation">
        Разместить объявление
      </Link>
    </Menu.Item>
  </Menu>
);

export default Header;
